import React, {useState} from 'react';
import 'react-slideshow-image/dist/styles.css'
import { Slide } from 'react-slideshow-image';
import axios from 'axios';
import './styles.css';

var Album = () => {
    const slideImages = [
        {
          url: 'slide1.png',
          caption: 'Slide 1'
        },
        {
          url: 'slide2.png',
          caption: 'Slide 2'
        },
        {
          url: 'slide4.jpg',
          caption: 'Slide 3'
        },
      ];
    return (
        <div>
            <div className="slide-container">
        <Slide>
            <div className="each-slide">
              <div style={{'backgroundImage': `url(slide1.png)`}}>
                <span>Image</span>
              </div>
            </div>
            <div className="each-slide">
              <img src="slide2" />
            </div>
            <div className="each-slide">
              <img src="slide3.png" />
            </div>
        </Slide>
      </div>
        </div>
    );
}

export default Album;
